import {Link} from 'react-router-dom';
import SearchBar from "../SearchBar/SearchBar";

const Nav=({onSearch})=>{

    return (
        <>
            <Link to='/about'></Link><button>About</button> 
            <button>Home</button> 
            <SearchBar onSearch={onSearch}/>
        </>
    )

}
export default Nav;
